import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './home.css';

const Home = () => {
  const navigate = useNavigate();

  const [mensaje, setMensaje] = useState("¡Bienvenido a HYPE DISTRICT, tu estilo comienza aquí!");
  const [visible, setVisible] = useState(true);
  const [showGoodbye, setShowGoodbye] = useState(false);

  useEffect(() => {
    if (mensaje) {
      const timer1 = setTimeout(() => {
        setVisible(false);
      }, 9000);

      const timer2 = setTimeout(() => {
        setMensaje("");
      }, 2500);

      return () => {
        clearTimeout(timer1);
        clearTimeout(timer2);
      };
    }
  }, [mensaje]);

  const handleCerrarSesion = () => {
    setShowGoodbye(true);
    setTimeout(() => {
      navigate('/'); // Redirige a la raíz
    }, 2000);
  };

  return (
    <div className="home-container">
      <nav className="navbar">
        {/* Logo a la izquierda */}
        <div className="logo">
          <img src="/imagenes/Logo1-removebg-preview.png" alt="Hype District Logo" className="logo-img" />
          <span>HYPE DISTRICT</span>
        </div>

        {/* Navegación central */}
        <div className="nav-center">
          <ul className="nav-links">
            <li onClick={() => navigate("/home")}>Inicio</li>
            <li onClick={() => navigate("/tienda")}>Tienda</li>
            <li onClick={() => navigate("/novedades")}>Novedades</li>
            <li onClick={() => navigate("/contact")}>Contacto</li>
          </ul>
        </div>

        {/* Iconos a la derecha */}
        <div className="nav-icons">
          <div className="nav-icon" onClick={() => navigate("/perfil")}>
            <img src="/imagenes/avatar1.png" alt="Perfil" className="perfil-img" />
          </div>
          <div className="nav-icon" onClick={() => navigate("/carrito")} title="Carrito">
            🛒
          </div>
          <div className="nav-icon" onClick={handleCerrarSesion} title="Cerrar Sesión">
            🚪
          </div>
        </div>
      </nav>

      {/* Mensaje de bienvenida */}
      {mensaje && (
        <div className={`mensaje-bienvenida ${visible ? "fade-in" : "fade-out"}`}>
          {mensaje}
        </div>
      )}

      {/* Sección principal */}
      <section className="hero-section">
        <div className="hero-background"></div>
        <div className="hero-overlay"></div>
        <div className="hero-content">
          <h1 className="hero-title">HYPE DISTRICT</h1>
          <p className="hero-subtitle">
            La cultura urbana se vive aquí. Encuentra tu estilo, tus zapatillas, tu look ideal.
          </p>
          <div className="supreme-box">Supreme</div>
        </div>
      </section>

      {/* Sección de contenido adicional */}
      <section className="content-section">
        <div className="container">
          <h2>Descubre lo Último en Street Fashion</h2>
          <p>
            En Hype District encontrarás las marcas más exclusivas y los diseños más innovadores del mundo del streetwear. Desde zapatillas limitadas hasta piezas únicas que definen las tendencias urbanas.
          </p>
        </div>
      </section>

      {/* Mensaje despedida */}
      {showGoodbye && (
        <div className="goodbye-message">
          ¡Gracias por visitarnos! Hasta pronto 👋
        </div>
      )}

      {/* Sección de destacados */}
      <div className="destacados">
        <div className="card">
          <h3>🔥 Zapatillas Exclusivas</h3>
          <p>Modelos únicos y coleccionables</p>
        </div>
        <div className="card">
          <h3>🎧 Estilo Urbano</h3>
          <p>Ropa y accesorios con flow callejero</p>
        </div>
        <div className="card">
          <h3>🧢 Comunidad</h3>
          <p>Únete a miles que viven el hype</p>
        </div>
      </div>
    </div>
  );
};

export default Home;
